import React from 'react'
import styled, { useState, useEffect } from 'styled-components'
import LeftColumn from '../LeftColumn/LeftColumn.jsx'
import RightColumn from '../RightColumn/RightColumn.jsx'
import axios from 'axios'


const Container = (props) => {


  const Container = styled.div`
    display: flex;
    width: 100%;
    justify-content: space-between;
  `;
  useEffect(() => {
    const IEX_API_KEY = 'pk_3256652724eb490abdfd234401050f50';
    const fetchStockData = async () => {
      const response = await axios.get(`https://cloud.iexapis.com/stable/stock/${`aapl`}/quote?token=${IEX_API_KEY}`)
      console.log(response)
    }
    fetchStockData()
  }, [])


  return (
    <Container>
      <LeftColumn symbol={props.match.params.symbol} />
      <RightColumn />
    </Container>
  );
}

export default Container;
